import { LOGIN_SUCCESS, LOGIN_FAIL } from '../actions/types';

const initialState = {
  loading: false,
  isAuthenticated: false,
};

export default function (state = initialState, action) {
  const { type, payload } = action;
  switch (type) {
    case LOGIN_SUCCESS:
      return {
        ...state,
      };
    case LOGIN_FAIL:
      return {
        ...state,
      };
    default:
      return state;
  }
}
